import React from 'react'

const CityOptionsForm = () => {
  return (
    <div className="multiple-choice">
        <button>Option 1</button>
        <button>Option 2</button>
        <button>Option 3</button>
        <button>Option 4</button>
    </div>
  )
}

export default CityOptionsForm
